// ==UserScript==
// @name        The West Duel Warner
// @author      Mr. Perseus
// @namespace   tw-perseus
// @description Warns if somebody is in duel range.
// @include     https://*.the-west.*/game.php*
// @include     http://*.the-west.*/game.php*
// @include     https://*.tw.innogames.*/game.php*
// @include     http://*.tw.innogames.*/game.php*
// @version     0.3.1
// @grant       none
// ==/UserScript==

/*globals $*/
(function (fn) {
    const script = document.createElement("script");
    script.setAttribute("type", "application/javascript");
    script.textContent = `(${fn})();`;
    document.body.appendChild(script);
    document.body.removeChild(script);
}(() => {
    const TWDW = {
        base64: {
            playWatchedPlayersBase64: new Audio("data:audio/wav;base64,"),
            playBeepBase64: new Audio("data:audio/wav;base64,"),
            menuImage: "url('data:image/png;base64,')",
        },
        defaultPreferences: {
            enableTWDW: true,
            enableIfProtected: false,
            playSound: true,
            repeatedSoundUntilClosed: false,
            watchedPlayers: "",
            allPlayersWatched: false,
        },
        version: "0.3.1",
        preferences: {},
        currentPos: "",
        positionDates: {},
        playersList: {},
        loadedDataArray: [],
        warningHighAmount: false,
        currentWatchList: [],
    };

    TWDW.Updater = {
        init () {
            setTimeout(TWDW.Updater.load, 5000);
        },

        load () {
            $.getScript("https://rawcdn.githack.com/mr-perseus/tw-js-library/master/script-updater.js", () => {
                if (scriptUpdater.TWDW > TWDW.version) {
                    const updateMessage = new west.gui.Dialog(
                        "Update: The West Duel Warner",
                        `<span>Update Available<br><br><b>v${scriptUpdater.TWDW}:</b><br>${scriptUpdater.TWDWNew
                            }</span>`, west.gui.Dialog.SYS_WARNING
                    ).addButton("Update", () => {
                        updateMessage.hide();
                        location.href = "https://greasyfork.org/scripts/40902-the-west-duel-warner/code/The%20West%20Duel%20Warner.user.js";
                    }).addButton("cancel").show();
                }
            });
        },
    };

    TWDW.Settings = {
        init () {
            const storage = JSON.parse(localStorage.getItem("TWDW_preferences"));
            TWDW.preferences = storage ? storage : TWDW.defaultPreferences;

            const div = $("<div class=\"ui_menucontainer\" />");
            const link = $("<div id=\"TWDW_Menu\" class=\"menulink\" title=\"The West Duel Warner\" />")
                .css("background-image", TWDW.base64.menuImage)
                .css("background-position", "0px 0px")
                .mouseenter(function () {
                    $(this).css("background-position", "-2px 0px");
                })
                .mouseleave(function () {
                    $(this).css("background-position", "0px 0px");
                });

            $(link).on("click", () => {
                TWDW.Settings.refreshMenu();
            });

            $("#ui_menubar").append((div).append(link).append("<div class=\"menucontainer_bottom\" />"));
        },

        refreshMenu () {
            const win = wman.open("TWDWSettings", "TWDW Settings", "noreload").setMaxSize(1268, 838).setMiniTitle("TWDW Settings");
            const scrollPane = new west.gui.Scrollpane();

            const setTextField = function (prefName, description) {
                const input = new west.gui.Textfield(`#TWDW_${prefName}`, "text");
                input.setValue(TWDW.preferences[prefName]);
                scrollPane.appendContent(input.getMainDiv());
                const button = new west.gui.Button("Save", () => {
                    TWDW.preferences[prefName] = input.getValue();
                    localStorage.setItem("TWDW_preferences", JSON.stringify(TWDW.preferences));
                    TWDW.Settings.refreshMenu();
                    new UserMessage("Okay", "success").show();
                });
                scrollPane.appendContent(button.getMainDiv());
                scrollPane.appendContent(`<br /> ${description} <br />`);
            };

            const setTitle = function (name) {
                scrollPane.appendContent(`<p><span style="font-size: 130%; font-weight: bold; font-style: italic; display: inline-block; margin-top: 20px;">${
                    name}</span></p>`);
            };

            const setCheckBox = function (prefName, text) {
                const checkbox = new west.gui.Checkbox(text);
                checkbox.setId(`TWDW_${prefName}`);
                if (TWDW.preferences[prefName]) {
                    checkbox.toggle();
                }
                checkbox.setCallback(() => {
                    TWDW.preferences[prefName] = checkbox.isSelected();
                    localStorage.setItem("TWDW_preferences", JSON.stringify(TWDW.preferences));
                    TWDW.Settings.refreshMenu();
                    new UserMessage("Okay", "success").show();
                });
                scrollPane.appendContent(checkbox.getMainDiv());
            };

            let htmlPlayersInfo = "";
            Object.keys(TWDW.playersList).forEach((property) => {
                htmlPlayersInfo += `, ${TWDW.Checker.getPlayerLink(TWDW.playersList[property].name)}`;
                if (TWDW.currentPos !== TWDW.playersList[property].pos) {
                    const difference = new Date().getTime() - TWDW.playersList[property].date;
                    htmlPlayersInfo += ` (at your old position ${Math.floor(difference / 60000) + 1} min ago)`;
                }
            });

            if (TWDW.warningHighAmount) {
                scrollPane.appendContent("<p><b>WARNING</b>: There are too many duelable players on this world to scan all of them. This script scans currently only the first 10 pages from the provided duel list (so you don't get timed out). If you are moving your character to a position far away, your current position might not be getting scanned.</p>");
            }

            if (htmlPlayersInfo !== "") {
                setTitle("Players next to you");
                scrollPane.appendContent(htmlPlayersInfo.slice(1));
            }

            let htmlWatchListInfo = "";
            TWDW.currentWatchList.forEach((player) => htmlWatchListInfo += `, ${TWDW.Checker.getPlayerLink(player)}`);
            if (htmlWatchListInfo !== "") {
                setTitle("Players on Watch list attackable");
                scrollPane.appendContent(htmlWatchListInfo.slice(1));
            }

            setTitle("General Settings");
            setCheckBox("enableTWDW", `Enable "The West Duel Warner" on this world (${document.domain})`);
            setTitle("Detailed Settings");
            setCheckBox("enableIfProtected", "Enable \"The West Duel Warner\" if you are duel protected (knocked out)");
            setCheckBox("playSound", "Play a warning sound if somebody moves to you (or you to him)");
            setCheckBox("repeatedSoundUntilClosed", "Repeat the warning sound until you close the warning flag.");
            setTitle("Watched Players");
            setTextField("watchedPlayers", "Enter the players to watch (comma separated, e.g.: \"Player1,Player2\"). If a player on this list gets attackable, you get notified.");
            setCheckBox("allPlayersWatched", "Watch all players");
            setTitle("Feedback");
            scrollPane.appendContent("<ul style=\"margin-left:15px;line-height:18px;\">" +
                "<li>Send a message to <a target=\"_blank\" href=\"https://www.the-west.de/?ref=west_invite_linkrl&player_id=83071&world_id=1&hash=0dc5\">Mr. Perseus on world DE1</a></li>" +
                "<li>Contact me on <a target=\"_blank\" href=\"https://greasyfork.org/forum/messages/add/Mr. Perseus\">Greasy Fork</a></li>" +
                "<li>Send me a message on the <a target=\"_blank\" href=\"https://forum.beta.the-west.net/index.php?conversations/add&to=Mr.%20Perseus\">The West Beta Forum</a> or the <a target=\"_blank\" href=\"https://forum.the-west.de/index.php?conversations/add&to=Mr.%20Perseus\">German The West Forum</a></li>" +
                "</ul><br />Check out other scripts on <a target=\"_blank\" href=\"https://greasyfork.org/de/users/179973-mr-perseus\">Greasyfork</a>.");

            win.appendToContentPane(scrollPane.getMainDiv());
        },
    };

    TWDW.Checker = {
        init () {
            TWDW.Checker.refreshPositionChecker();
            TWDW.Checker.refreshOpponentChecker();
        },

        refreshOpponentChecker () {
            let level = 0;

            const analyzeNextLevel = function (resp) {
                const pcList = resp["oplist"]["pclist"];

                pcList.forEach((player) => TWDW.loadedDataArray.push(player));

                if (pcList.length >= 4 && level < 9) {
                    level++;
                    $.post(
                        `/game.php?window=duel&action=search_op&h=${Player.h}`,
                        {
                            page: level,
                        },
                        analyzeNextLevel, "json"
                    );
                } else {
                    TWDW.warningHighAmount = level >= 9;
                    TWDW.Checker.analyzeData();
                }
            };

            if (TWDW.preferences.enableTWDW && (TWDW.preferences.enableIfProtected || !Character.isDuelProtected())) {
                TWDW.loadedDataArray = [];
                $.getJSON(`/game.php?window=duel&action=search_op&h=${Player.h}`, analyzeNextLevel);
            }

            const interval = Math.floor(Math.random() * 120000) + 240000;

            console.log(`The West Duel Warner: Refreshed data, next refresh in ${interval / 60000} minutes.`);

            setTimeout(TWDW.Checker.refreshOpponentChecker, interval);
        },

        refreshPositionChecker () {
            const currentDate = new Date().getTime();

            const pos = `${Character.position.x.toString()}-${Character.position.y.toString()}`;
            TWDW.positionDates[pos] = currentDate;

            if (TWDW.currentPos !== pos) {
                TWDW.currentPos = pos;

                Object.keys(TWDW.positionDates)
                    .forEach((property) => currentDate - TWDW.positionDates[property] > 900000 && delete TWDW.positionDates[property]);

                TWDW.Checker.analyzeData();
            }

            setTimeout(TWDW.Checker.refreshPositionChecker, 10000);
        },

        analyzeData () {
            const warningListCurrentPosition = [];
            const warningListAllPositions = [];
            const newPlayersList = {};
            const newCurrentWatchList = [];
            const warningListWatchList = [];

            TWDW.loadedDataArray.forEach((data) => {
                const playerName = data["player_name"];
                const playerId = data["player_id"];
                const loadedPos = `${data["character_x"].toString()}-${data["character_y"]}`;

                if (TWDW.positionDates.hasOwnProperty(loadedPos) && !newPlayersList.hasOwnProperty(playerId)) {
                    const playerInfo = {
                        name: data["player_name"],
                        date: TWDW.positionDates[loadedPos],
                        pos: loadedPos,
                    };
                    newPlayersList[playerId] = playerInfo;
                    if (!TWDW.playersList.hasOwnProperty(playerId)) {
                        if (loadedPos === TWDW.currentPos) {
                            warningListCurrentPosition.push(playerInfo);
                        } else {
                            warningListAllPositions.push(playerInfo);
                        }
                    }
                }

                if (TWDW.preferences.allPlayersWatched || (TWDW.preferences.watchedPlayers && TWDW.preferences.watchedPlayers.toLowerCase().indexOf(playerName.toLowerCase()) > -1)) {
                    newCurrentWatchList.push(playerName);
                    if (TWDW.currentWatchList.indexOf(playerName) === -1) {
                        warningListWatchList.push(playerName);
                    }
                }
            });

            TWDW.playersList = newPlayersList;
            TWDW.currentWatchList = newCurrentWatchList;

            const isWarning = warningListCurrentPosition.length !== 0 || warningListAllPositions.length !== 0;
            if (isWarning) {
                let playerListStr = "WARNING: NEW PLAYERS NEXT TO YOU: ";
                warningListCurrentPosition.forEach((singleWarningCurrentPosition) => playerListStr += `<br />${TWDW.Checker.getPlayerLink(singleWarningCurrentPosition.name)}`);
                warningListAllPositions.forEach((currentWarningAllPositions) => {
                    const difference = new Date().getTime() - currentWarningAllPositions.date;
                    playerListStr += `<br />${TWDW.Checker.getPlayerLink(currentWarningAllPositions.name)
                        } (at your old position ${Math.floor(difference / 60000) + 1} min ago)`;
                });

                TWDW.Checker.notify(playerListStr, "system_icon_warning", TWDW.base64.playBeepBase64);
            }

            const notifyWatchList = function () {
                let playerListStr = "PLAYERS ON WATCH LIST ATTACKABLE: ";
                warningListWatchList.forEach((warningPlayer) => playerListStr += `<br />${TWDW.Checker.getPlayerLink(warningPlayer)}`);

                TWDW.Checker.notify(playerListStr, "system_icon_ok", TWDW.base64.playWatchedPlayersBase64);
            };

            if (warningListWatchList.length !== 0) {
                if (isWarning) {
                    setTimeout(notifyWatchList, 10000);
                } else {
                    notifyWatchList();
                }
            }
        },

        notify (text, type, sound) {
            if (!document.getElementById("TWDW_Container")) {
                document.body.insertAdjacentHTML("beforeend", "<div id=\"TWDW_Container\"></div>");

                document.getElementById("TWDW_Container").addEventListener("click", () => {
                    document.getElementById("TWDW_Container").innerHTML = "";
                }, false);
            }

            document.getElementById("TWDW_Container").innerHTML = `${"<div id=\"TWDW_Warning\" class=\"tw2gui_dialog\" style=\"cursor: pointer; max-width: 800px; opacity: 100; left: 35%; top: 20px;\">" +
                " <div class=\"tp_front\">" +
                "  <div class=\"tw2gui_bg_tl\"></div>" +
                "  <div class=\"tw2gui_bg_tr\"></div>" +
                "  <div class=\"tw2gui_bg_bl\"></div>" +
                "  <div class=\"tw2gui_bg_br\"></div>" +
                " </div>" +
                " <div class=\"tw2gui_inner_window_title\">" +
                "  <div class=\"tw2gui_inner_window_title_left\"></div>" +
                "  <div class=\"tw2gui_inner_window_title_right\"></div>" +
                "  <div class=\"textart_title\" style=\"font-style: normal; font-variant: normal; font-weight: bold; font-stretch: normal; font-size: 20pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">" +
                "TW Duel Warner" +
                "  </div>" +
                " </div>" +
                " <div class=\"tw2gui_dialog_content\">" +
                "  <div class=\"tw2gui_dialog_icon "}${type}${"\"></div>" +
                "  <div class=\"tw2gui_dialog_text\" style=\"font-size: 20px; padding: 12px 0; max-width: 600px; float: none; margin-left: 75px;\">"}${
                    text
                    }  </div>` +
                "  <div style=\"clear: both;\"></div>" +
                " </div>" +
                "<div>";

            const playSound = function () {
                sound.play().then(() => {
                });
            };

            const playSoundRepeatedly = function () {
                if (document.getElementById("TWDW_Container").innerHTML !== "") {
                    playSound();
                    setTimeout(playSoundRepeatedly, 10000);
                }
            };

            if (TWDW.preferences.repeatedSoundUntilClosed) {
                playSoundRepeatedly();
            } else if (TWDW.preferences.playSound) {
                playSound();
            }
        },

        getPlayerLink (name) {
            return `<a href='javascript:void(parent.PlayerProfileWindow.open(encodeURIComponent("${name}")));'>${name}</a>`;
        },
    };

    $(document).ready(() => {
        try {
            TWDW.Updater.init();
            TWDW.Settings.init();
            TWDW.Checker.init();
        } catch (err) {
            console.log(err.stack);
        }
    });
}));